import React from 'react';
import './Header.css';

export default () => {
  return(
    <header>
      <div className="headerLogo">
        <a href="/">
          <img src="../img/netflixLogo.png" alt="Netflix Logo"/>
        </a>
      </div>
    </header>
  );
}
